import {Link} from "react-router-dom";
import Style from "..//Landing/landing.module.css"
import Imagen from "../../Components"


const Landing = ()=>{
    return(
        <img>
            <div>
                <h1>Este Es el Landing Page</h1>
                
                <Link to="/home">Catch em All!</Link>

            </div>
        </img>
    )
}

export default Landing;
